import React, { useState, useEffect } from 'react';
import Service from '../../API/Service';
import { Table, Button } from 'react-bootstrap';

const Animals = () => {
  const [animals, setAnimals] = useState([]);

  useEffect(() => {
    const fetchPosts = async () => {
      const response = await Service.getAnimals();
      console.log("asda", response)
      setAnimals(response);
    };

    fetchPosts();
  }, []);

  const handleDelete = async (animalId, e) => {
    e.preventDefault();
    const response = await Service.deleteAnimal(animalId);  
    setPosts(animals.filter((animal) => animal.animal_id !== animalId));  
  };

  return (
    <div>
      <Table striped bordered hover>
        <thead>
          <tr>
            <th>ID</th>
            <th>Species</th>
            <th>Description</th>
            <th>Action</th>
          </tr>
        </thead>
        <tbody>
          {animals.map(animal => (
            <tr key={animal.animal_id}>
              <td>{animal.animal_id}</td>
              <td>{animal.animal_species}</td>
              <td>
                <Button variant="primary" onClick={(e) => handleEdit(animal.animal_id, e)}>Edit</Button>
                <Button variant="danger" onClick={(e) => handleDelete(animal.animal_id, e)}>Delete</Button>
              </td>
            </tr>
          ))}
        </tbody>
      </Table>
    </div>
  );
}


export default Animals
